const headerJquery= ()=>{
    var $;
    $ = require('jquery');
    console.log("head Jquery")
    $('.hamburgerContainer').click(function(){
        console.log('click')
        if($('.hamburgerContainer').hasClass('active')){
        $('.hamburgerContainer').removeClass('active');
        }
        else{
            $('.hamburgerContainer').addClass('active');
        }
    })

}
export default headerJquery
